"original": |2-
     This status-code is used when the request is for something that
     cannot happen.  For example, there might be a request to cancel a Job
     that has already been canceled or aborted by the system.  The IPP
     Client SHOULD NOT repeat the request.
"fixed": |-
  This status-code is used when the request is for something that cannot happen.  For example, there might be a request to cancel a Job that has already been canceled or aborted by the system.  The IPP Client SHOULD NOT repeat the request.
"ko": |-
  이 상태 코드는 일어날 수 없는 일에 대한 요청일 때 사용됩니다. 예를 들어 시스템에서 이미 취소했거나 중단한 작업을 취소하라는 요청이 있을 수 있습니다. IPP 클라이언트는 요청을 반복해서는 안 됩니다.
